import React , { Component } from 'react';

class Movie extends Component {

    constructor(props){
        super(props);

        this.state = {
            title : '',
            director : ''
        }
    }

    // console.log(props.match.params.id + " " + props.match.params.title)

    componentWillMount(){
        if(this.props.location.hasOwnProperty('params'))
            {
                this.setState({
                    title : '',
                    director : ''
                });

            }
    }

    render(){
    return(
        <div>
            <h3>Title : {this.state.title}</h3>
            <h3>Director: {this.state.director}</h3>
        </div>
    );
    }
}

export default Movie;
